import React, { useState } from "react";

function SignupLoginPage() {
  const [isSignUpClicked, setIsSignUpClicked] = useState(false);
  const [isLoginClicked, setIsLoginClicked] = useState(false);
  return (
    <div
      style={{
        height: "100vh",
        width: "100vw",
        backgroundColor: "#F2F2F2",
        display: "flex",
      }}
    >
      <div
        style={{
          backgroundColor: "#FFFFFF",
          height: "78vh",
          width: "86vw",
          marginLeft: "7vw",
          marginRight: "7vw",
          marginTop: "10vh",
          marginBottom: "12vh",
          borderRadius: "15px",
          boxShadow: "0px 0px 30px 0px #00000026",
        }}
      >
        <div
          style={{
            height: "10%",
            width: "100%",
            marginTop: "6vh",
          }}
        >
          <p
            style={{
              fontSize: "5.5vh",
              fontWeight: "600",
              textAlign: "center",
              color: "#474444",
            }}
          >
            QUIZZIE
          </p>
        </div>

        <div
          style={{
            height: "11%",
            width: "100%",
            display: "flex",
          }}
        >
          <button
            style={{
              height: "60%",
              width: "13%",
              background: "none",
              border: "none",
              marginTop: "2vh",
              marginLeft: "28.5vw",
              color: "#474444",
              fontWeight: "bold",
              fontSize: "2.7vh",
            }}
          >
            Sign Up
          </button>
          <button
            style={{
              height: "60%",
              width: "13%",
              background: "none",
              border: "none",
              marginTop: "2vh",
              marginLeft: "7vw",
              color: "#474444",
              fontWeight: "bold",
              fontSize: "2.7vh",
            }}
          >
            Log In
          </button>
        </div>

        <div
          style={{
            height: "50%",
            width: "100%",
            backgroundColor: "red",
            marginTop: "3vh",
          }}
        ></div>

        <div
          style={{
            height: "8%",
            width: "100%",
            backgroundColor: "green",
            marginTop: "3vh",
            marginBottom: "2vh",
          }}
        ></div>
      </div>
    </div>
  );
}

export default SignupLoginPage;
